description:
And yet another Jordi Bernet book, The Journey Home, once again done by relieta and myself.

In 2250, the governments of Earth have decided to put all their prisoners on a prison planet, Goblin. Goblin is a cesspit of cruelty and horror, with over ten million male inmates.
But fortune smiles on a lucky group of inmates, and soon they are on their way home. But are they welcome on Earth?
